// Importing React and the components
import React from "react";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Home from "./pages/Home";

 import "./App.css"
function App() {

  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<CardsSection />} />
          <Route path="/hamla" element={<Hamla />} />
        </Routes>
      </Router>
      <Navbar />
      <Home />
      <Footer />
    </div>
  );
}

export default App;
